  render: () => {
    const theme: ThemeSpecification = {
      colors: {
        primary: {
          500: "#3B82F6",
          600: "#2563EB",
          700: "#1D4ED8"
        }
      },
      components: {
        Button: {
          // Base styles for all buttons
          global: {
            className: "font-medium transition-all duration-200"
          },
          // Variant-specific styles
          variants: {
            primary: {
              className: "bg-primary-500 text-white hover:bg-primary-600"
            }
          },
          // Size-specific styles
          sizes: {
            lg: {
              className: "text-lg px-6 py-3"
            }
          },
          // Special combination override
          combinations: [{
            variant: "default",
            size: "lg",
            className: "bg-gradient-to-r from-primary-500 via-primary-600 to-primary-700 text-white px-8 py-4 text-xl font-bold shadow-2xl hover:shadow-3xl transform hover:scale-105",
            styles: {
              borderRadius: "999px",
              letterSpacing: "0.1em"
            }
          }]
        }
      }
    };
    const spec: UISpecification = {
      version: "1.0.0",
      root: {
        type: "Flex",
        direction: "column",
        gap: "6",
        children: [{
          type: "Heading",
          level: "h2",
          className: "text-2xl font-bold",
          children: "Combination Overrides"
        }, {
          type: "Text",
          className: "text-gray-600",
          children: "The primary + large combination has special styling"
        }, {
          type: "Grid",
          columns: "3",
          gap: "4",
          children: [
          // Regular variants
          {
            type: "Button",
            variant: "default",
            size: "sm",
            children: "Primary Small"
          }, {
            type: "Button",
            variant: "default",
            size: "md",
            children: "Primary Medium"
          }, {
            type: "Button",
            variant: "default",
            size: "lg",
            children: "✨ Special Combo"
          },
          // Other sizes with primary
          {
            type: "Button",
            variant: "secondary",
            size: "lg",
            children: "Secondary Large"
          }, {
            type: "Button",
            variant: "outline",
            size: "lg",
            children: "Outline Large"
          }, {
            type: "Button",
            variant: "ghost",
            size: "lg",
            children: "Ghost Large"
          }]
        }]
      },
      theme
    };
    const ui = render(spec);
    return <ThemeProvider theme={theme}>{ui}</ThemeProvider>;
  }
